(8, 'สร้างพื้นที่ปลอดภัยระหว่างตัวฉันตัวเธอ ครั้งที่ 1', 'สร้างพื้นที่ปลอดภัยระหว่างตัวฉันตัวเธอ ครั้งที่ 1 กระบวนการฟังอย่างตั้งใจ ไม่ตัดสิน', '2020-06-30', '09:00:00', '2020-06-30', '16:00:00', 'ด้านกิจกรรมและนันทนาการ', 'ภาคปกติ', 6, '106396986_660247471586757_3024065825728324276_n.jpg'),
(9, 'กิจกรรมถวายเทียนพรรษา ปี 2563', 'ถวายเทียนพรรษาวัดหัวป้อมใน', '2020-07-03', '13:30:00', '2020-07-03', '16:30:00', 'ด้านชาติศาสน์กษัตริย์', 'ภาคปกติ', 3, '84631489_908083036338779_4452984503044316352_n.jpg'),
(10, 'กิจกรรม ทำเจลแอลกอฮอล์ล้างมือ', '', '2020-07-03', '13:30:00', '2020-07-03', '16:30:00', 'ด้านเศรษกิจพอเพียง', 'ภาคปกติ', 3, 'alcohol-gel-350x250.jpg'),
(11, 'กิจกรรมไหว้ครู ประจำปี 2563', 'วันพฤหัสบดีที่ 6 สิงหาคม 2563 ทางวิทยาลัยฯ กำหนดให้เป็นวันไหว้ครูประจำปีการศกษา 2563 ของนักศึกษาภาคปกติ ตั้งแต่เวลา 08:00-10:00 น. ', '2020-08-06', '08:00:00', '2020-08-06', '10:00:00', 'ด้านชาติศาสน์กษัตริย์', 'ภาคปกติ', 2, '65099954_2232540343529190_5162817067958665216_o.jpg'),
(12, 'กิจกรรมไหว้ครู ประจำปี 2563', 'วันอาทิตย์ที่ 9 สิงหาคม 2563 ทางวิทยาลัยฯ กำหนดให้เป็นวันไหว้ครูประจำปีการศกษา 2563 ของนักศึกษาภาคปกติ ตั้งแต่เวลา 08:00-10:00 น.', '2020-08-09', '08:00:00', '2020-08-09', '10:00:00', 'ด้านชาติศาสน์กษัตริย์', 'ภาคเสาร์-อาทิตย์', 2, '65304600_2234147093368515_1617338955433246720_o.jpg'),
(13, 'บริจาคโลหิตครั้งที่ 1 ประจำปี 2563', 'วันที่พฤหัสบดีที่ 20 สิงหาคม 2563 เวลา 08:30-11:45 น  ขอเชิญ นศ ที่มีคุณสมบัติพร้อมสำหรับการบริจาคโลหิต (อายุ 17 ปีบริบูรณ์ ในวันบริจาค น้ำหนัก 45 กก) ร่วมบริจาคโลหิตช่วยเหลือเพื่อนมนุษย์ กับ รพ สงขลา \r\n\r\nสิทธิพิเศษ สำหรับผู้บริจาค\r\n1 ชั่วโมงการเข้าร่วมกิจกรรม 4 ชั่วโมง\r\n2 คะแนนความประพฤติ +5\r\n\r\nนศ ที่สนใจเข้าร่วมกิจกรรมนี้ กรุณากดเข้าร่วมกิจกรรมก่อนวันที่ 16 สิงหาคม 2563 เพื่อทางวิทยาลัยจะได้เช็คยอดผู้มีความประสงค์ และแจ้งไปยัง รพ สงขลา ทราบต่อไป', '2020-08-20', '09:00:00', '2020-08-20', '12:00:00', 'ด้านชาติศาสน์กษัตริย์', 'ทั้งหมด', 4, 'FB_IMG_1596591602679.jpg'),
(14, 'ทำบุญศาสนาอิสลามประจำปี', 'เป็นประจำทุกปี ที่ทางวิทยาลัยฯ ทำบุญศาสนาอิสลาม โดยได้เรียนเขิญโต๊ะอีหม่ามประจำมัสยิดบ้านบน มาเป็นผู้นำในการทำบุญ ซึ่งทางวิทยยาลัยเองก็ให้ความสำคัญกับทุก ๆ ศาสนาอย่างเท่าเทียมกัน', '2020-08-13', '08:30:00', '2020-08-13', '10:30:00', 'ด้านชาติศาสน์กษัตริย์', 'ภาคปกติ', 2, 'FB_IMG_1597248297572.jpg'),
(15, 'สร้างพื้นที่ปบอดภัยให้ตัวฉันและตัวเธอครั้งที่ 2', 'เข้าใจตนเอง เข้าใจผู้อื่น และมีพื้นที่ปลอดภัย กับทีมงาน เพนกวิน school of change maker', '2020-08-27', '08:30:00', '2020-08-27', '16:30:00', 'ด้านกิจกรรมและนันทนาการ', 'ทั้งหมด', 8, '106396986_660247471586757_3024065825728324276_n.jpg'),
(16, 'เข้าค่ายนันทนาการ', 'ขอเชิญ นักศึกษา ภาคปกติทุกคน เข้าค่ายนันทนาการและส่องสัตว์ยามค่ำคืน @สวนสัตว์สงขลา 2-3 กันยายน 2563', '2020-09-02', '08:00:00', '2020-09-03', '12:00:00', 'ด้านกิจกรรมและนันทนาการ', 'ภาคปกติ', 14, 'IMG_20200828_221331.jpg');
