(87, '20548 ', 'ZOOMเสนอหัวข้อโปรเจค', 'เสนอหัวข้อการทำโปรเจค กิจการร้านขายไม้ เป็นร้านขายปลีกเเละขายส่งเเละการอธิบายข้อมูลพื้นฐานของกิจการให้อาจารย์ว่าเป็นประมาณไหนเเละได้รับข้อเสนอที่ดีในการทำหัวข้อเพิ่มเติมเเละต้องหาหัวข้อสำคัญในการที่จะต้องไปหาเพิ่มในกิจการนัน เช่น ร้านมีรายจ่ายเท่าไร \r\n ขายเป็นเงินสดหรือเงินเชื่อ มีลูกจ้างไหม  มีการบริการหลังการขายอย่างไร  ลงบิลการซื้อสินค้าอย่างไร ที่สำคัญ  กิจการร้านขายไม้จะต้องเน้นเรื่องของการสต็อกสินค้า', '2020-08-25', '20:30:00', '21:30:00', '1.0', 'inbound498982922377273002.jpg', 'อนุญาต'),
(88, '20548 ', 'ลงข้อมูลพื้นฐานของกิจการ วันที่26/8/63  13:00-13:30  ครึ่งช.ม', 'การลงของมูลของกิจการที่สำคัญเเละลงรายละเอียดสินค้าที่มีการขายในร้านเเละมีการลงบิลให้กับคนที่มาซื้อสินค้าอย่างไรในร้านมีลูกจ้างกี่คนมีค่าใช้จ่ายในร้านอะไรบ้าง เช่น ค่าน้ำ ค่าไฟ ค่าอินเตอร์เน็ต เเละสิ่งที่สำคัญของกิจการคือการสต็อกของทีละเยอะๆ', '2020-08-26', '18:30:00', '19:30:00', '1.0', 'inbound518789222999758026.jpg', 'อนุญาต'),
(89, '20665 ', 'ประชุมกับอาจารย์ที่ปรึกษาของศูนย์บ่มเพาะถึงหัวข้อที่จะทำและรายละเอียดของกิจการ', 'ได้ช่วยกันคิดหัวข้อโครงการกับเพื่อนในกลุ่มโดยมีอาจารย์นพรัตน์คอยให้คำแนะนำให้การตั้งชื่อโครงการ และได้รู้ข้อมูลรายละเอียดของกิจการที่เราจะทำว่าเป็นกิจการแบบไหน ซึ่งก็มีอาจารย์นพรัตน์คอยให้คำปรึกษาและให้ข้อมูลในการศึกษาครั้งนี้', '2020-08-25', '16:00:00', '17:30:00', '1.5', 'IMG_0934.jpg', 'อนุญาต'),
(90, '20665 ', 'นำเสนอหัวข้อโครงการกับอาจารย์ประจำวิชา', 'ได้รู้ว่ากิจการที่เราเลือกมานั้นเหมาะกับการที่จะนำมาทำโครงการหรือไม่มีความยากหรือง่ายอย่างไร และอาจารย์ยังให้คำแนะนำในการเลือกใช้โปรแกรมสำเร็จรูปให้เหมาะกับลักษณะของกิจการที่เลือกมา รวมถึงให้คำแนะนำว่าเราควรจะมีข้อมูลเบื้องต้นอะไรบ้างเกี่ยวกับกิจการที่เราจะทำ', '2020-08-25', '20:00:00', '21:00:00', '1.0', 'IMG_0302.jpeg', 'อนุญาต'),
(91, '20553 ', 'ประชุมกับอาจารย์ที่ปรึกษาของศูนย์บ่มเพาะถึงหัวข้อที่จะทำและรายละเอียดของกิจการ', 'ได้ช่วยกันคิดหัวข้อที่จำทำกับเพื่อนในกลุ่มโดยมีอาจารย์นพรัตน์ค่อยแนะนำการตั้งชื่อโครงงานแบบไหนถึงจะเหมาะสมและให้เกิดความน่าสนใจในหัวข้อ และได้รับรู้รายละเอียดของกิจการคร่าวว่ากิจการที่จะทำเป็นรูปแบบไหน ซึ่งมีอาจารย์ให้คำแนะนำในครั้งนี้', '2020-08-25', '16:00:00', '17:30:00', '1.5', 'received_807150470092485.jpeg', 'อนุญาต'),
(92, '20553 ', 'พูดเกี่ยวกับรายละเอียดของกิจการที่จะทำกับอาจารย์ประจำวิชา', 'ได้ศึกษาและได้รับแนวทางในการที่จะทำหัวข้อโปรเจคและมีการแนะนำให้นักศึกษาว่าควรเลือกกิจการแบบไหนที่จะสามารถทำแล้วได้คะแนนเยอะหรือกิจการที่สามารถมีของเล่นให้เยอะ ในกลุ่มศูนย์บ่มเพาะได้รับการอนุมัติและจะศึกษาการเขียนคำร้อง', '2020-09-25', '20:00:00', '21:00:00', '1.0', 'received_305003354090857.jpeg', 'อนุญาต'),
(93, '20553 ', 'การเขียนใบคำร้องการทำโปรเจค', 'ศึกษาการเขียนคำร้องจากของรุ่นพี่และเรียนรู้การตั้งค่าหน้ากระดาษและการจัดรูปแบบ', '2020-09-08', '12:00:00', '13:00:00', '1.0', 'received_305003354090857.jpeg', 'อนุญาต'),
(94, '20665 ', 'ทำแบบคำร้องนำเสนอหัวข้อโครงการ', 'ได้รู้วิธีการพิมพ์แบบคำร้องขอนำเสนอหัวข้อโครงการ และได้ฝึกการช่วยกันทำงานภายในทีม', '2020-09-08', '12:00:00', '13:00:00', '1.0', 'IMG_0932.jpg', 'อนุญาต'),
(95, '20557 ', 'เขียนใบคำร้องนำเสนอหัวข้อโปรเจค', 'ได้รู้เกี่ยวกับวิธีการพิมพ์ในคำร้องที่จะนำไปเสนออาจารย์', '2020-09-08', '12:00:00', '13:00:00', '1.0', 'de4258ee27cd89a367f596ea370b1411.0.jpg', 'อนุญาต'),
(96, '20832 ', 'วันไหว้ครู/รับน้อง', 'ได้รู้ถึงพระคุณครู และได้รู้จักรุ่นน้อง\r\nปวส.1 เกือบทุกคน', '2020-08-09', '08:30:00', '13:00:00', '4.5', 'IMG_20200810_093411_808.jpg', 'ไม่อนุญาต'),
(97, '20679 ', 'คุยรายละเอียดกับอาจารย์ที่ปรึกษา', 'คุยรายละเอียดและข้อมูลเนื้อหากับอาจารย์ที่ปรึกษา', '2563-08-13', '17:30:00', '18:30:00', '1.0', 'IMG_6796.jpeg', 'ไม่อนุญาต'),
(98, '20679 ', 'ทำแบบคำร้องและคิดโครงเรื่อง', 'ทำแบบคำร้องเสนอโครงการ และคิดโครงเรื่องในการทำคลิป', '2563-08-15', '10:30:00', '14:30:00', '4.0', 'IMG_7010.jpg', 'ไม่อนุญาต'),
