(113, '20853 ', 'ประชุมหาหัวข้อโปรเจค เป็นการประชุมเพื่อหาหัวข้อใยการจัทำโครงการ โดยเสนอกันมาภายในกลุ่มคนละ2-3หัวข้อโครงการ', 'ฝึกกระบวนการคิดและวิเคราะห์ถึงชิ้นงานที่จะทำเพื่อเสริมสร้างทักษะทางด้านความคิด การนำความ้มาประยุกต์ใช้ในการจัดทำโครงการ', '2020-07-19', '16:00:00', '17:30:00', '1.5', 'received_349212193154621.jpeg', 'ไม่อนุญาต'),
(114, '20853 ', 'การเลือกหัวข้อโปรเจคที่เสนอ เป็นการนำหัวข้อโปรเจคที่เสนอมาทั้งหมด เพื่อมาเลือกของตัวเองคนละ1หัวข้อเท่านั้น', 'ได้เป็นการถกเถียงกันเพื่อแสดงความคิดเห็นเกี่ยวกับหัวข้อที่ตนเองเสนอ และแสดงถึงข้อดีและข้อเสียของโครงการที่ตัวเองเสนอเพื่อเป็นการปนะกอบการพิจารณา​', '2020-08-22', '15:45:00', '17:30:00', '1.8', 'CYMERA_20200909_212653.jpg', 'ไม่อนุญาต'),
(115, '20853 ', 'เสนอหัวข้อโครงการ เป็นการยื่นเสนอหัวข้อโครงการที่สนใจจะทำจริงๆ เสนอกับครูที่ปรึกษา​และครูผู้สอนวิชาโครงการ เพื่อขอความคิดเห็น และสรุปมาเพียง1โครงการและเป็นแนวทางในการดำเนินการ', 'ทำให้เกิดการแลกเปลี่ยนความคิดเห็น ข้อดีข้อเสียของแต่ละโครงการ ระหว่างครูกับนักเรียน ทำให้เกิดกระบวนการคิดสิ่งใหม่ๆขึ้น และสามารถทำให้สรุปหัวข้อโครงการได้เพียง1โครงการที่สามารถทำได้จริง', '2020-08-30', '20:00:00', '21:30:00', '1.5', 'received_351553785890270.png', 'ไม่อนุญาต'),
