(129, '20679 ', 'เตรียมตัวก่อนสอบถามเก็บข้อมูล', 'เตรียมตัวก่อนเข้าไปสอบถามความคิดเห็นของเพื่อนๆและน้องๆหลังจากดูคลิป เพื่อนำข้อแก้ไขมาปรับปรุง', '2563-09-08', '17:00:00', '18:00:00', '1.0', '119019547_241692563835008_7276611167792130612_n.jpg', 'ไม่อนุญาต'),
