(131, '20665 ', 'ดูคลิปวิดีโอและทำแบบทดสอบของตลาดหลักทรัพย์ หลักสูตรการเป็นผู้ประกอบการ เรื่อง Entrepreneurial Mindset', 'ได้รู้แนวทางและการเตรียมความพร้อมสำหรับการเป็นผู้ประกอบการมือใหม่ และรู้ทักษะดีๆที่ผู้ประกอบการควรมีรวมถึงเข้าใจแนวดคิดของผู้ประกอบในปัจจุบันที่จะต้องเรียนรู้การเปลี่ยนแปลงอยู่ตลอดเวลา และสามารถนำทักษะความรู้นี้ไปใช้ต่อยอดในอนาคตได้', '2020-07-09', '20:00:00', '21:00:00', '1.0', 'เกียรติบัตร-1.pdf', 'ไม่อนุญาต'),
(132, '20665 ', 'ดูคลิปวิดีโอและทำแบบทดสอบของตลาดหลักทรัพย์ หลักสูตรการเป็นผู้ประกอบการ เรื่อง Design Thinking', 'ได้รู้ทักษะสำคัญที่นำมาใช้ในการพัฒนานวัตกรรม รวมถึงเห็นภาพรวมของกระบวนการทั้ง 5 ขั้นตอน และเทคนิค วิธีการเข้าใจลูกค้าอย่างแท้จริง ได้เข้าใจวิธีการสร้างไอเดียที่หลากหลาย และยังสามารถนำความคิดในการออกแบบมาใช้ในชีวิตประจำวันได้อีกด้วย', '2020-07-13', '19:38:00', '20:38:00', '1.0', 'เกียรติบัตร-3.pdf', 'ไม่อนุญาต'),
(133, '20665 ', 'ดูคลิปวิดีโอและทำแบบทดสอบของตลาดหลักทรัพย์ หลักสูตรการเป็นผู้ประกอบการ เรื่อง Pitching Technique', 'ได้เรียนรู้การสร้าง point หรืองานนำเสนอในธุรกิจให้สวยงาม มีเทคนิคในการเลือกโทนสี และสามารถถ่ายทอดเรื่องราวของธุรกิจให้นักลงทุนเกิดความสนใจได้ อีกทั้งยังทำให้เราสามารถนำเสนองานได้อย่างมืออาชีพ', '2020-07-12', '18:12:00', '19:12:00', '1.0', 'Certificate-ESD1002-TH.pdf', 'ไม่อนุญาต'),
(134, '20665 ', 'ดูคลิปวิดีโอและทำแบบทดสอบของตลาดหลักทรัพย์ หลักสูตรการเป็นผู้ประกอบการ เรื่อง Lean Canvas', 'ได้รู้จักเครื่องมือที่มีประโยชน์ต่อการนำมาใช้ลดความเสี่ยงจากการเริ่มต้นธุรกิจใหม่ และเข้าใจถึงองค์ประกอบทั้ง 9 ช่องในการเริ่มทำธุรกิจใหม่ สามารถนำวิธีการเหล่านี้ไปประยุกต์ใช้ในการพัฒนาธุกิจ หรือโครงการที่เริ่มขึ้นใหม่ได้อย่างถูกต้องและเหมาะสม', '2020-07-28', '18:26:00', '19:26:00', '1.0', 'Certificate-BMD1002-TH.pdf', 'ไม่อนุญาต'),
(135, '20845 ', 'ประชุมหาหัวข้อโปรเจค เพื่อหาหัวข้อในการทำโครงการ โดยการนำเสนอมาภายในกลุ่ม คนละ 2-3 หัวข้อ', 'ฝึกกระบวนการคิดและวิเคราะห์ชิ้นงานที่จะทำขึ้น เพื่อเป็นการเสริมสร้างทักษะทางด้านความคิด และการนำความรู้มาประยุกต์ใช้ในการจัดทำโครงการ', '2020-07-19', '16:00:00', '17:30:00', '1.5', 'โปรเจค1.jpg', 'อนุญาต'),
(136, '20845 ', 'เลือกหัวข้อโปรเจคที่เสนอ นำหัวข้อโปรเจคที่เสนอมาทั้งหมด เพื่อนำมาเลือกของตัวเองคนละ 1 หัวข้อเท่านั้น และเตรียมนำเสนอครูที่ปรึกษา', 'ได้แสดงความคิดเห็นเกี่ยวกับหัวข้อโปรเจคที่ตัวเองนำเสนอ และแสดงถึงข้อดี ข้อเสียของโครงการที่ตัวเองนำเสนอเป็นการประกอบการพิจารณา', '2020-08-22', '15:45:00', '17:30:00', '1.8', 'โปรเจค2.jpg', 'อนุญาต'),
(137, '20845 ', 'เสนอหัวข้อโครงการ ยื่นเสนอหัวข้อโครงการที่สนใจจะทำจริงๆ เสนอกับครูที่ปรึกษา​และครูผู้สอนวิชาโครงการ เพื่อขอความคิดเห็น และสรุปมาเพียง 1 โครงการและเป็นแนวทางในการดำเนินการ', 'ทำให้เกิดการแลกเปลี่ยนความคิดเห็น ข้อดี ข้อเสียของแต่ละโครงการ ระหว่างครูกับนักเรียน ทำให้เกิดกระบวนการคิดสิ่งใหม่ๆขึ้น และสามารถทำให้สรุปหัวข้อโครงการได้เพียง 1 โครงการที่สามารถทำได้จริง', '2020-08-30', '20:00:00', '21:30:00', '1.5', 'โปรเจค3.png', 'อนุญาต'),
(138, '20553 ', 'ดูคลิปวิดิโอและทำแบบทดสอบ Lean Canvas', 'ได้เรียนรู้และเข้าใจเครื่องมือการนำมาใช้ลดความเสี่ยงจากการเริ่มต้นธุรกิจใหม่และสามารถเห็นตัวอย่างและวิธี Lean Canvas', '2020-07-27', '17:00:00', '18:00:00', '1.0', 'IMG_20200911_124514.jpg', 'ไม่อนุญาต'),
(139, '20553 ', 'ดูคลิปวิดิโอและทำแบบทดสอบตลาดหลักทรัพย์หลักสุตรการเป็นผู้ประกอบการเรื่อง  Digital Marking', 'ได้เรียนรู้ทักษะที่นำมาใช้ในการพัฒนานวัตกรรม และสามารถเห็นภาพรวมของกิจการใน5ขั้นตอนและเทคนิควิธีการเข้าใจลูกค้าได้เข้าใจวิธีการสร้างไอเดียได้หลายรูปแบบ', '2020-07-13', '17:00:00', '18:00:00', '', 'Screenshot_2020-09-11-12-42-38-80_e46acc4301d552178f1fc7f923d8665c.png', 'ไม่อนุญาต'),
(140, '20553 ', 'ดูคลิปวิดิโอและทำแบบทดสอบตลาดหลักทรัพย์หลักสุตรการเป็นผู้ประกอบการเรื่อง  Entrepreneurial Mindset', 'การเตรียมความพร้อมสำหรับการที่จะเป็นผู้ประกอบการมือใหม่และรู้ทักษะดีๆที่ผู้ประกอบการควรมีและจำเป็นที่จะต้องปฏิบัติเข้าใจแนวคิดของการเป็นผู้ประกอบการที่ดี', '2020-07-09', '17:00:00', '18:00:00', '1.0', 'IMG_20200911_124427.jpg', 'ไม่อนุญาต'),
(141, '20553 ', 'ดูคลิปวิดิโอและทำแบบทดสอบตลาดหลักทรัพย์หลักสุตรการเป็นผู้ประกอบการเรื่อง  Entrepreneurial Mindset', 'การเตรียมความพร้อมสำหรับการที่จะเป็นผู้ประกอบการมือใหม่และรู้ทักษะดีๆที่ผู้ประกอบการควรมีและจำเป็นที่จะต้องปฏิบัติเข้าใจแนวคิดของการเป็นผู้ประกอบการที่ดี', '2020-07-09', '17:00:00', '18:00:00', '1.0', 'IMG_20200911_124427.jpg', 'ไม่อนุญาต'),
(142, '20854 ', 'ดูคลิป ทำความเข้าใจและ ฝึกการเล่นเกม เสนอกิจกรรมการเล่นเกมส์', 'ฝึกการเล่นเกมเพื่อนำไปทำกิจกรรมให้กับน้องๆ\r\nมีเกมส์ การสื่อสาร รอดหรือตาย เม็ดหิน การเรียงลำดับ เป็นการฝึกทักษะก่อนเริ่มเรียนให้กับน้องๆ\r\nเช่น ทักษะการคิด การวิเคราะห์ การสั่งซื้อ\r\nการสื่อสาร การแก้ปัญหาแบบร่วมมือ เหตุผลเชิงตรรกะ คำนวณค่าเฉลี่ย ตัวเลขแบบสุ่ม และรวมไปถึงงานสหกรณ์  นอกจากนี้เรายังได้มอบหมายงานในกลุ่มเพื่อแบ่งกันไปทำที่บ้าน เพื่อให้เป็นการเร็วต่อการทำโปรเจ็คอีกด้วย', '2020-09-11', '12:00:00', '14:30:00', 'NaN', 'FF99422D-1291-49D1-8200-795403968F43.jpeg', 'ไม่อนุญาต'),
(143, '20854 ', 'สอนใช้ ทีมในการนำเสนอโปรเจ็ค', '-ใช้ทีมในการแชร์ข้อมูลและเอกสารโปรเจ็ค\r\n-ใช้ทีมในการติดตามข้อมูลการทำโปรเจ็ค\r\n-การสร้างกลุ่มโปรเจ็คในทีม\r\n-การสั่งงานโปรเจ็คในทีม', '2020-08-04', '10:00:00', '12:30:00', 'NaN', 'CC3D23E8-BA5D-4583-9755-0972BBA0F7C2.jpeg', 'ไม่อนุญาต'),
(144, '20854 ', 'ได้รับการมอบหมายงาน และทำงานจาก อาจารย์ เอกศักดิ์ เทพยา', 'ได้รับการมอบหมายงานการฝึกเล่นเกมและดูคลิป ในการเล่นเกม ได้แปลเอกสารและทำความเข้าใจในเอกสารจากเกมบางส่วน ทั้งหมด 37 เกม ได้แปลและทำความเข้าใจบางส่วนแล้ว สามเกม มอบหมายงานในทีม และแปะลิ้งค์ไว้เพื่อให้ง่ายต่อการค้นหา และมอบหมายงานให้นำกลับไปทำที่บ้างอีกบางส่วน เพื่อทำความเข้าใจ และเสนอสิ่งที่ได้รับจากการทำความเข้าใจในวันต่อไป', '2020-09-10', '12:20:00', '14:40:00', 'NaN', 'image.jpg', 'ไม่อนุญาต'),
(145, '20781 ', 'การเดินและการกระโดดจนถึงเส้นชังโดยการใช้โค้ด', 'ได้คิดวิเคราะห์ในการเอาโค้ดมาใส่ในการเดินและการกระโดดว่าจะเดินกี่ครั้งกระโดดกี่ครั้งจนถึงเส้นชัง', '2020-08-28', '13:30:00', '15:30:00', '2.0', 'IMG20200828092938.jpg', 'ไม่อนุญาต');
