(616, '20565', 'สร้างพื้นที่ปบอดภัยให้ตัวฉันและตัวเธอครั้งที่ 2', 'เป็นพี่ประจำฐาน​ ฐานปีศาจแห่งความกลัวและนพลักษณ์​ ปีศาจเเห่งความกลัว​ จะให้ทุกคนนึกถึงความกลัวของตนเองแล้วจะให้ระบายอารมณ์​ความรู้สึกความกลัวนั้นออกมาโดยการรีดดินน้ำมัน​ลงบนกระดาษจะเป็นรูปที่มีความหมายหรือรูปที่ไม่มีความหมายก็ได้​ แค่ได้ระบายออกมาลดความกลัวลงบ้าง​ และอีกฐานนึงคือนพลักษณ์​ คือการได้รู้จักตนเองว่าตนเองนิสัยเเบบไหน​ อยู่ลักษณ์​ที่เท่าไหร่​ แล้วลักษณ์​ไหนที่จะมาช่วยเติมเต็มคนลักษณ์​อย่างเราให้ออกมาสมบูรณ์​', '2020-08-27', '08:30:00', '2020-08-27', '16:30:00', '8', 'ด้านกิจกรรมและนันทนาการ', 'inbound2912225427182547967.jpg'),
